import "../css/NavUpSec.css";

const NavUpSec = () => {
    return (
        <>
      <div className="navsec">
        <h1 className='teams-title'>Teams</h1>
      </div>
      <div className='row'>
        <BiDotsHorizontal className='dot-icon'/>
        <BsPeopleCircle className='circle-icon'/>
        </div>
    </>
    )
}

export default NavUpSec;
